        <Link to="/" className="nav-item"><Menu size={18} /> Dashboard</Link>
        <Link to="/students" className="nav-item"><User size={18} /> Students</Link>
        <Link to="/troubleshoot" className="nav-item"><Activity size={18} /> Troubleshoot</Link>
